pragma solidity ^0.5;

import "./Forwarder.sol";


interface Registry {
    function register(uint128 expiration, uint128 strike) external returns (address);
    function token(uint128 expiration, uint128 strike) external returns (address);
}

interface Token {
    function transferFrom(address,address,uint256) external returns (bool);
    function approve(address,uint256) external returns (bool);
}

library RegistryLib {}
library TokenLib {}
library USD {}

contract ETHPutOptionTokenProxy is Forwarder {
    constructor(uint128 expiration, uint128 strike, uint128 quantity, address to, bytes memory data) public payable {
        Registry registry = Registry(address(RegistryLib));
        address registered = registry.token(expiration, strike);

        if (registered != address(0)) {
            Token(address(USD)).transferFrom(msg.sender, address(this), uint256(quantity * strike / 1 ether));
            Token(address(USD)).approve(registered, quantity);
            (bool result,) = registered.call(abi.encodeWithSignature("writeApproveAndCallAsOrigin(uint128,uint128,uint128,address,bytes)", expiration, strike, quantity, to, data));
            require(result);
            selfdestruct(tx.origin);
        } else {
            registry.register(expiration, strike);
            (bool result,) = address(TokenLib).delegatecall(abi.encodeWithSignature("writeApproveAndCall(uint128,uint128)", expiration, strike));
            require(result);
        }
    }
}
